import React, { useState, useEffect } from "react";
import "./Auth.css";

function Home({ onLogout }) {
  const [posts, setPosts] = useState([]);
  const [newPost, setNewPost] = useState("");
  const [commentText, setCommentText] = useState({});
  const [currentUser, setCurrentUser] = useState("");

  useEffect(() => {
    // Get posts from localStorage
    const storedPosts = JSON.parse(localStorage.getItem("posts")) || [];
    setPosts(storedPosts);

    // Get current logged-in user from localStorage (you can store during login)
    const storedUser = JSON.parse(localStorage.getItem("currentUser"));
    if (storedUser) setCurrentUser(storedUser.email);
  }, []);

  const savePosts = (updatedPosts) => {
    setPosts(updatedPosts);
    localStorage.setItem("posts", JSON.stringify(updatedPosts));
  };

  const handleAddPost = () => {
    if (!newPost.trim()) return;

    const updatedPosts = [
      {
        id: Date.now(),
        author: currentUser,
        content: newPost,
        comments: [],
      },
      ...posts,
    ];

    savePosts(updatedPosts);
    setNewPost("");
  };

  const handleAddComment = (postId) => {
    if (!commentText[postId]?.trim()) return;

    const updatedPosts = posts.map((post) => {
      if (post.id === postId) {
        const updatedComments = [
          ...post.comments,
          { id: Date.now(), author: currentUser, text: commentText[postId] },
        ];
        return { ...post, comments: updatedComments };
      }
      return post;
    });

    savePosts(updatedPosts);
    setCommentText({ ...commentText, [postId]: "" });
  };

  return (
    <div className="auth-container">
      <div className="auth-card">
        <h1 className="auth-title">ConVINCE Blog</h1>
        <h2 className="auth-subtitle">
          Welcome, {currentUser}! Share your thoughts below.
        </h2>

        <button
          onClick={() => {
            localStorage.removeItem("currentUser");
            onLogout();
          }}
          className="auth-button"
          style={{ marginBottom: "1rem" }}
        >
          Logout
        </button>

        {/* Add new post */}
        <textarea
          className="auth-input"
          style={{ minHeight: "80px" }}
          placeholder="Write a new post..."
          value={newPost}
          onChange={(e) => setNewPost(e.target.value)}
        />
        <button onClick={handleAddPost} className="auth-button" style={{ marginTop: "0.5rem" }}>
          Post
        </button>

        {/* Display posts */}
        {posts.length === 0 ? (
          <p className="auth-hint" style={{ marginTop: "1rem" }}>No posts yet.</p>
        ) : (
          posts.map((post) => (
            <div
              key={post.id}
              className="auth-card"
              style={{ marginTop: "1.5rem", padding: "1rem" }}
            >
              <p style={{ fontWeight: "600", marginBottom: "0.5rem" }}>
                {post.author}
              </p>
              <p style={{ marginBottom: "0.5rem" }}>{post.content}</p>

              {/* Comments */}
              <div style={{ marginBottom: "0.5rem" }}>
                {post.comments.map((c) => (
                  <div key={c.id} style={{ fontSize: "0.9rem", marginBottom: "0.3rem" }}>
                    <strong>{c.author}:</strong> {c.text}
                  </div>
                ))}
              </div>

              <input
                className="auth-input"
                type="text"
                placeholder="Add a comment..."
                value={commentText[post.id] || ""}
                onChange={(e) =>
                  setCommentText({ ...commentText, [post.id]: e.target.value })
                }
              />
              <button
                onClick={() => handleAddComment(post.id)}
                className="auth-button"
                style={{ marginTop: "0.3rem" }}
              >
                Comment
              </button>
            </div>
          ))
        )}
      </div>
    </div>
  );
}

export default Home;
